When we moved into our new home, we wanted something that would reflect our minimalistic taste yet be deeply rooted in Indian heritage. That’s when I came across the Ashiesh Shah capsule collection for West Elm, which fit in seamlessly into my home. 

What I love is that this capsule of rugs and cushions is beautifully handcrafted by local artisans in Jaipur. So I know I’m supporting the artisans and craftmanship of my own country, while also getting the best in international design and style. This is easily my favourite corner in our home!

